const formatMarketOrder = ({
    order,
    dexId,
}) => ({
    id: order.id,
    dexId,
    account: order.account,
    timestamp: order.timestamp * 1000,
    bidUnit: Number(order.bid.split(' ')[0]),
    bidToken: order.bid.split(' ')[1],
    askUnit: Number(order.ask.split(' ')[0]),
    askToken: order.ask.split(' ')[1],
    unitPrice: Number(order.unit_price),
});

module.exports = formatMarketOrder;
